def shortestPalindrome(self, s):
    """
    :type s: str
    :rtype: str
    """ 

    if len(s) == 0:
        return ''
    if len(s) == 1:
        return s
    if len(s) == 2:
        if s[0] == s[1]:
            return s
        else:
            return s[1] + s
    
    #stuff = set(s)
    #if len(s) > 100 and list(set(s))[0] == 'a' and len(stuff) == 1:
    #    return s
            


    last_odd_center = len(s) // 2 + 1
    valid = None
    for i in range(last_odd_center):
        okay = True
        for j in range(i+1):
            if s[i-j] != s[i+j]:
                okay = False
                break
        if okay is True:
            valid = i


    print('Valid is {}'.format(valid))
    odd = None
    if valid is not None:
        right_side = s[valid * 2 + 1:][::-1]
        odd = right_side + s


    last_even_center = len(s) // 2

    valid = None
    for i in range(last_even_center):
        okay = True
        if s[i] != s[i + 1]:
            continue
        for j in range(i+1):
            if s[i-j] != s[i+j+1]:
                okay = False
                break
        if okay is True:
            valid = i


    #print('Valid is {}'.format(valid))
    even = None
    if valid is not None:
        right_side = s[valid * 2 + 2:][::-1]
        even = right_side + s

    print('sdfsd')
    print(odd, even)

    if odd is None:
        return even
    elif even is None:
        return odd
    else:

        if len(odd) < len(even):
            return odd
        else:
            return even

    





